// home flow
import React, {Component} from 'react';
import {homeFlow} from './navigation';

class Home extends Component{
    constructor(props){
        super(props);

        // create state with token, username, email
        this.state = {
            jwt: this.props.jwt,
            username: "",
            email: ""
        };
        
    };

    // identify user based on jwt will be somewhere here
    // an async function to update the state

    render(){
        // send state for screens
        return homeFlow(this.state);
    };
}

export default Home;
